import React, { useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';
import './AnimatedBackground.css';

const AnimatedBackground = ({ children, particleCount = 50 }) => {
  const particlesRef = useRef(null);

  useEffect(() => {
    createParticles();
  }, [particleCount]);

  const createParticles = () => {
    const particlesContainer = particlesRef.current;
    if (!particlesContainer) return;

    particlesContainer.innerHTML = '';

    for (let i = 0; i < particleCount; i++) {
      const particle = document.createElement('div');
      particle.classList.add('particle');
      
      const size = Math.random() * 6 + 2;
      particle.style.width = `${size}px`;
      particle.style.height = `${size}px`;
      particle.style.left = `${Math.random() * 100}%`;
      particle.style.bottom = `-${size}px`;
      const duration = Math.random() * 15 + 10;
      particle.style.animationDuration = `${duration}s`;
      const delay = Math.random() * 5;
      particle.style.animationDelay = `${delay}s`;
      
      particlesContainer.appendChild(particle);
    }
  };

  return (
    <div className="animated-background-container">
      <div className="background">
        <div className="particles" ref={particlesRef}></div>
      </div>
      
      <div className="content">
        <div className="main-content-wrapper">
          {/* Left Side - Welcome Content */}
          <div className="welcome-section">
            <div className="logo-space">
              <img src="/logo-ptc.png" alt="PTC LOGO" className="logo" />
            </div>

            <div className="welcome-content">
              <h1>Pateros Technological College</h1>
              <p className="welcome-subtitle">
                Student Portal - Institutional Access Required
              </p>
              
              <div className="button-container">
                <Link to="/login" className="action-btn primary-btn">
                  Student Login
                </Link>
              </div>
              
              <div className="login-info">
                <p><strong>Access Requirements:</strong></p>
                <ul>
                  <li>PTC Institutional Email Account</li>
                  <li>Valid Student Credentials</li>
                  <li>Active Enrollment Status</li>
                </ul>
              </div>
            </div>
          </div>

          {/* Right Side - Info Card */}
          <div className="info-card-section">
            <div className="info-card">
              <div className="info-card-content">
                <h2>Campus Announcements</h2>
                <div className="announcement-list">
                  <div className="announcement-item">
                    <h3>Enrollment Period</h3>
                    <p>Next semester enrollment starts on January 15, 2024</p>
                  </div>
                  <div className="announcement-item">
                    <h3>Academic Calendar</h3>
                    <p>Check the updated academic calendar for important dates</p>
                  </div>
                  <div className="announcement-item">
                    <h3>Student Portal Updates</h3>
                    <p>New features added to enhance your learning experience</p>
                  </div>
                </div>
                
                <div className="quick-links">
                  <h3>Quick Links</h3>
                  <div className="links-container">
                    <a href="#" className="quick-link">Academic Resources</a>
                    <a href="#" className="quick-link">Student Handbook</a>
                    <a href="#" className="quick-link">Campus Map</a>
                    <a href="#" className="quick-link">IT Support</a>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>

        {children}
      </div>
    </div>
  );
};

export default AnimatedBackground;
